import React from "react";
import Cart from "./components/cart/index";
import NotFound from "./components/notFound/notFound";
import Home from "./components/home/ProductsList";
import { ShoppingCartOutlined } from "@ant-design/icons";
import Index from "./components/Table/Index";
import { Badge,Avatar } from "antd";


const routes = [
  {
    title: <h3>Products</h3>,
    path: "/",
    exact: true,
    main: () => <Home />,
  },
  {
    title: <h3>Contact</h3>,
    path: "/contact",
    main: () => <h1>contact</h1>,
  },
  {
    title: <h3>Table</h3>,
    path: "/table",
    main: () => <Index />,
  },
  {
    // title: <h3><ShoppingCartOutlined style={{fontSize:"1em"}} />Cart</h3>,
    title: (
      <h2>
         <span className="avatar-item">
          <Badge count={1}>
            Cart
            <Avatar style={{marginLeft: 5}} shape="square" icon={<ShoppingCartOutlined />} />
          </Badge>
         </span>
       </h2>
    ),
    path: "/manager",
    main: () => <Cart />,
  },
  {
    title: "",
    path: "",
    main: () => <NotFound />,
  },
];
export default routes;
